import React from 'react';
import '../../App.css'

const Header = () => {
    return (
       <header className='header'>
           <div className='container'>
               <ul>
                   <li>Home</li>
                   <li>About</li>
                   <li>Projects</li>
                   <li>Contacts</li>
               </ul>
           </div>
       </header>

    );
};

export default Header;
